import React from "react";
import { Carousel } from "react-bootstrap";
import "../component/landing.css";
import image from "../asset/06-opp-dm-mobile-banner-1080x745-now-pl-f01-071223-64bab982784c7-1.jpg";
import image2 from "../asset/photo_2_2023-03-06_20-11-10.jpg";
import image3 from "../asset/photo_3_2023-03-06_20-11-10.jpg";
const Landing = () => {
  return (
    <div className="landing">
      {" "}
      <Carousel>
        <Carousel.Item>

         <div className="mage"></div> 
          
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <div className="image">
            {" "}
            <img src={image2} />
          </div>
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <div className="image">
            {" "}
            <img src={image3} />
          </div>
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
      <div className="container-fluid"></div>
    </div>
  );
};
export default Landing;
